import "./donation.css"
import React, { useState } from 'react';
import { FaUser, FaDollarSign, FaShare, FaExclamationTriangle } from 'react-icons/fa';

function Donation() {
  const [showShareWindow, setShowShareWindow] = useState(false);
  const [showReportWindow, setShowReportWindow] = useState(false);
  const [amount, setAmount] = useState(5000);
  const [target, setTarget] = useState(30000);
  const [selectedReason, setSelectedReason] = useState('');

  const handleDonateNow = () => {
    // Code to navigate to another page for donation
  };

  const handleShare = () => {
    setShowShareWindow(true);
  };

  const handleReport = () => {
    setShowReportWindow(true);
  };

  const handleCheckboxChange = (event) => {
    setSelectedReason(event.target.value);
  };

  const handleSubmitReport = () => {
    // Code to submit the report with selected reason
  };

  return (
    <div className="donation-container">
      <div className="donation-left">
        {/* Picture */}
        <img src="path_to_picture" alt="Pot Picture" />
      </div>
      <div className="donation-right">
        {/* Title */}
        <h2>Donation Title</h2>
        {/* Username */}
        <div className="username">
          <FaUser color="blue" />
          <p>Username</p>
        </div>
        {/* Amount */}
        <div className="amount">
          <p>{amount}</p>
          <FaDollarSign />
        </div>
        {/* Target */}
        <p>The target is to raise {target} $</p>
        {/* Range */}
        <div className="range" style={{ width: `${(amount / target) * 100}%`, backgroundColor: 'orange' }}></div>
        {/* Buttons */}
        <div className="buttons">
          <button onClick={handleDonateNow} className="red-button">Donate Now</button>
          <button onClick={handleShare} className="blue-button"><FaShare /> Share</button>
          <button onClick={handleReport} className="red-button"><FaExclamationTriangle /> Report</button>
        </div>
      </div>

      {/* Share Window */}
      {showShareWindow && (
        <div className="share-window">
          {/* Share window content */}
        </div>
      )}

      {/* Report Window */}
      {showReportWindow && (
        <div className="report-window">
          <h3>Please select a problem:</h3>
          <div className="checkboxes">
            <label>
              <input type="checkbox" value="Fraudulent Activities" onChange={handleCheckboxChange} /> Fraudulent Activities
            </label>
            <label>
              <input type="checkbox" value="Lack of Transparency" onChange={handleCheckboxChange} /> Lack of Transparency
            </label>
            <label>
              <input type="checkbox" value="Misrepresentation" onChange={handleCheckboxChange} /> Misrepresentation
            </label>
            <label>
              <input type="checkbox" value="Ethical Concerns" onChange={handleCheckboxChange} /> Ethical Concerns
            </label>
            <label>
              <input type="checkbox" value="Questionable Intentions" onChange={handleCheckboxChange} /> Questionable Intentions
            </label>
            <label>
              <input type="checkbox" value="Others" onChange={handleCheckboxChange} /> Others...
            </label>
          </div>
          <button onClick={handleSubmitReport}>Submit</button>
        </div>
      )}
    </div>
  );
}

export default Donation;
